INSERT INTO `tour` (`id`, `tour_name`, `address`, `no_of_day`, `rating`, `reviewes`, `price`, `tax`, `other_facilities`, `tour_type`, `no_of_people`, `overview`, `image`, `included`, `excluded`, `itinerary`, `why_choose_us`, `images`, `created_at`, `updated_at`) VALUES
(11, 'Dubai – Abu Dhabi Tour', 'Delhi', '7', '5', '10', '660', '5', 'Hotels, Meals, Sightseeing', 'single', '2', 'Tour HighlightsDubai:Half-Day New Dubai City Tour by Dubai Tourism Authorized Tour GuideOne Way Monorail ride at Atlantis the Palm during Half Day City tour.Desert Safari with BBQ Dinner02 Hrs. Yacht RideBurj Khalifa at Top view 124th Floor Entry Ticket.Dubai Mall Visit, Musical Fountain Show at time of Burj Khalifa visitGlobal VillageMiracle Garden01 Hour Limo RideAbu Dhabi:Abu Dhabi City Tour with Sheikh Zayed Grand Mosque VisitComplimentary Access to Any 02 Park during stay at Yas Island (Ferrari World / Warner Bros Theme / Yas Water Park/SeaWorld)', '61645.jpg', 'Economy Class Return Airfare Ex. AhmedabadAccommodation at Hotel with daily buffet breakfast.Dinner at Indian Veg RestaurantHotel Tourism Dirham Tax.All Tours and Transfers with Group.Inter Hotel Transfer', 'Terms of Personal nature Such as Mineral Water, Tips, PorterageAny increase in Airfare, overseas Mediclaim Insurance.RTPCRCost of meal other than mentioned in inclusions.GST and TCS Extra as per actual at the time of final payment.', '[\"ArrivalUpon arriving at Abu Dhabi International Airport, you will be met and greeted. From there, you will be transferred to Dubai, where you can enjoy a hearty breakfast at an Indian vegetarian restaurant. Check-in at your hotel will be in line with international standard check-in times, although early check-in is subject to availability.In the evening, embark on a memorable yacht ride, immersing yourself in a two-hour yacht experience. Later, indulge in a delectable dinner at an Indian restaurant. After a day filled with adventures, you\'ll be dropped back at your hotel for an overnight stay.\",\"Dubai City TourStart your day with a delightful buffet breakfast at your hotel.After breakfast, embark on a Dubai City tour. The pick-up is scheduled between 9:30 AM to 10:00 AM. During the tour, you\'ll have a photo stop at the iconic \'Burj Al Arab,\' and you\'ll get to visit other notable landmarks like Dubai Sheikh Zayed Road, Palm Jumeirah, and many other scenic spots while enjoying the breathtaking view of Dubai city.In the evening, it\'s time for a remarkable experience. You will visit the Burj Khalifa\'s 124th floor, known as \\\"At the Top.\\\" The time slot for this visit will be as per slot availability. From this towering vantage point, you\'ll be able to look down from the world\'s tallest building and enjoy a breathtaking view of the city. Don\'t miss the amazing musical fountain show at the Dubai Fountain.Conclude your day with a scrumptious dinner at an Indian restaurant. After a day filled with sightseeing and exploration, you\'ll be dropped back at your hotel for an overnight stay.\",\"Desert safariStart your day with a delightful buffet breakfast at your hotel.Next, you have a special experience lined up: a 1-hour limo ride, where you can enjoy luxury and comfort.In the afternoon, you will be picked up for the Desert Safari adventure. The pick-up is scheduled between 2:30 PM to 3:00 PM. You\'ll embark on a thrilling Dune Bashing experience, taking you deep into the heart of the desert.After the exciting desert ride, you\'ll head to a Desert Camp where you\'ll receive a traditional Arabian welcome and soak in the Arabian ambiance. The camp offers various activities, including a camel ride, henna painting, an opportunity to try on Arabic costumes, or simply enjoy the aromatic sheesha.In the evening, a buffet dinner awaits you at the camp, featuring a wide variety of barbecue meals, salads, main courses, and desserts. You\'ll also be entertained with an exotic belly dance performance.After an exhilarating day in the desert, you\'ll be dropped back at your hotel for an overnight stay. Please note that carrying liquor during the Desert Safari is strictly prohibited due to local regulations.\",\"Global Village & Miracle GardenBegin your day with breakfast at the hotel.During the first half of the day, you have the opportunity for shopping and leisure, particularly at Global Village. After that, explore the stunning Miracle Garden.In the evening, enjoy dinner at an Indian restaurant.Conclude your day with an overnight stay at the hotel.\",\"Abu Dhabi TourBegin your day with a hearty breakfast at your hotel, followed by a transfer to another hotel in Abu Dhabi. Your day will be filled with exploration as you embark on an Abu Dhabi city tour. This tour includes visits to the country\'s largest mosque, Swami Narayan Temple, and the chance to admire other iconic structures of Abu Dhabi. Don\'t forget to capture memories with a photo stop at Ferrari World Theme Park and YAS Mall. In the evening, savor a delicious dinner at an Indian restaurant before returning to your hotel for an overnight stay.\",\"Abu DhabiYou will have complimentary access to any one park on Yas Island, which can be easily reached via a free shuttle bus. After your park visit, enjoy a delightful dinner at Rasoi Ghar an Indian restaurant.\",\"DepartureYour day\'s plan includes complimentary access to one of the parks on Yas Island, with easy transportation via a free shuttle bus. Check-out from your hotel is set for 12:00 PM, and if you need a late checkout, it can be arranged based on availability for an extra cost. Conclude your trip with a delicious dinner at an Indian restaurant. Finally, you\'ll be taken back to Abu Dhabi airport, ensuring you arrive approximately 4 hours before your scheduled flight, allowing ample time for departure procedures.\"]', 'Best Travel Partner', '32328.jpg', '2023-11-30 04:10:17', '2023-12-18 03:31:42');
